import React from "react";
import { Router, Switch, Route } from "react-router";
import Health from "../subRoutes/Health";
import Science from "../subRoutes/Science";
import Sports from "../subRoutes/Sports";
import Entertainment from "../subRoutes/Entertainment";
import Business from "../subRoutes/Business.js";
import Technology from "../subRoutes/Technology";

function TopicsPage(props) {
   return (
      <Router>
         <Switch>
            <Route exact path="/topics/health" component={Health}></Route>
            <Route exact path="/topics/science">
               <Science />
            </Route>
            <Route exact path="/topics/sports">
               <Sports />
            </Route>
            <Route exact path="/topics/entertainment">
               <Entertainment />
            </Route>
            <Route exact path="/topics/business">
               <Business />
            </Route>
            <Route exact path="/topics/technology">
               <Technology />
            </Route>
         </Switch>
      </Router>
   );
}

export default TopicsPage;
